    // Create the TeamBuilder Angular application.
    var angApp = angular.module('TeamBuilder', []);

    // Create the TeamBuilder controller and set the values to be loaded by the UI. 
    angApp.controller('TeamBuilderCtrl', function ($scope) {
        $scope.listItems = [
           { "name": "Rolandinho Jimenez", "rate": 150.00, "value": 1 },
           { "name": "Humberto Lazamax", "rate": 130.00, "value": 2 },
           { "name": "Juan Balmori", "rate": 120.00, "value": 3 },
           { "name": "Tristan Davis", "rate": 120.00, "value": 4 },
           { "name": "Dorrene Brown", "rate": 180.00, "value": 5 },
           { "name": "Keyur Patel", "rate": 100.00, "value": 6 }
        ];

        $scope.lead = $scope.listItems[0];
        $scope.ui = $scope.listItems[1];
        $scope.eng1 = $scope.listItems[2];
        $scope.eng2 = $scope.listItems[3];
        $scope.hours = 16;
        $scope.total = function () { return ($scope.lead.rate + $scope.ui.rate + $scope.eng1.rate + $scope.eng2.rate) * $scope.hours };
    });

    // Using the OfficeJS API. Insert OOXML at the selected insertion point.
    function setData() {
        Office.context.document.setSelectedDataAsync(assignTeam(oxml), { coercionType: Office.CoercionType.Ooxml },
            function (result) {
                if (result.status != Office.AsyncResultStatus.Succeeded) {
                    app.showNotification('Error:', result.error.message);
                }
            }
        );
    }

    // Replace tokens in the OOXML with the values held in the global scope.
    function assignTeam(t) {
        var scope = angular.element($("#team")).scope();
        t = t.replace("{{lead}}", scope.lead.name);
        t = t.replace("{{leadRate}}", scope.lead.rate);
        t = t.replace("{{ui}}", scope.ui.name);
        t = t.replace("{{uiRate}}", scope.ui.rate);
        t = t.replace("{{eng1}}", scope.eng1.name);
        t = t.replace("{{eng1Rate}}", scope.eng1.rate);
        t = t.replace("{{eng2}}", scope.eng2.name);
        t = t.replace("{{eng2Rate}}", scope.eng2.rate);
        var avgRate = (scope.lead.rate + scope.ui.rate + scope.eng1.rate + scope.eng2.rate) / 4;
        t = t.replace("{{avgRate}}", avgRate);
        t = t.replace("{{hours}}", scope.hours);
        t = t.replace("{{total}}", scope.total());
        return t;
    }

